import './App.css';
import Header from './components/Header';

function App() {

  return (
    <div className='App'>
      <Header/>
      <input type='checkbox' name='agreement' id='agreement-el' />
      <label htmlFor='agreement-el'>동의</label>
    </div>
  );
}

export default App;
